import React from 'react';

const Card =({id,groupid,userid,fileurl,title}) => {

    return (

        <div className='tc bg-near-white dib br3 pa3 ma2 grow bw2 shadow-5'>
            <img alt='memory' src={fileurl} className='w5'/>
            <div>
                <h2>{title}</h2>
                <p>Userid:{userid}</p>
            </div>
        </div>
    )
}

const CardCollection = ({memories})=>{


    if(Array.isArray(memories)){
        return (
            <div>
                {
                    memories.map((memory,i) => {
                    return (
                        <Card 
                            key={i} 
                            id={memories[i].id}
                            groupid={memories[i].groupid}
                            userid={memories[i].userid}
                            fileurl={memories[i].fileurl}
                            title={memories[i].title}
                        />
                        )
                    })
                }
            </div>
        )
    }else{
        return (
            <div> No memories Found

            </div>
        )
    }

}


export {Card,CardCollection};
